Robert Palmer  - Looking for Clues [TopPop tv show 1981].VOB 



Very HQ very rare (not found on youtube) tv show promo. AVRO's &quot;TopPop&quot; was the first weekly pop program broadcast on Dutch television. It ran from September 22, 1970 to June 27, 1988. 

&quot;TopPop&quot; was mainly filled with pop artists in the top pop studio, playing to their latest hit. During the years of 1970-1974, 1978-1981 and 1986-1988, the artists were selected by the choice of the Viewer. In the years 1974-1978 and 1981-1986, the National Charts were used. 

&quot;Looking for Clues&quot; is a song from Clues, Robert Palmer's sixth solo album, released in 1980. It has a rockier, new wave edge compared to his previous releases. The album peaked at number 59 on the Billboard Top Pop Albums chart and #31 in the UK in 1980. Donald Guarisco of Allmusic described Clues as &quot;one of Robert Palmer's strongest and most consistent albums,&quot; despite being somewhat short at 31 minutes.
